let formsetContainer=document.querySelectorAll(".formset-container"),form=document.querySelector("#form"),addFormsetButton=document.querySelector("#add-formset"),totalForms=document.querySelector("#id_form-TOTAL_FORMS"),formsetNum=formsetContainer.length-1;function $addFormset(e){e.preventDefault();let t=formsetContainer[0].cloneNode(!0),o=RegExp("form-(\\d){1}-","g");formsetNum++,t.innerHTML=t.innerHTML.replace(o,"form-${formsetNum}-"),form.insertBefore(t,addFormsetButton),totalForms.setAttribute("value","${formsetNum + 1}")}addFormsetButton.addEventListener("click",$addFormset);